import React from 'react';
import "../css/test.css"
const Checkbox = () =>{

    return(

        <div  className='checkbox_div'>

            <input type="checkbox" value='Yes'/>
            <input type="checkbox" value='No'/>
            <input type="checkbox" value='Sometimes'/>
        </div>


    );

}

export default Checkbox;
